import React from "react";

const Project = () => {
  return (
    <>
      <a
        href="https://theformvalidator.netlify.app"
        target="_blank"
        class="project project-tile"
      >
        <img
          class="project-image"
          src="img/form validateimage.jpg"
          alt="project"
        />
        <p class="project-title">The form validator</p>
      </a>
    </>
  );
};

export default Project;
